OccamsRecord provides find_each and find_in_batches methods that work similarly to their counterparts in ActiveRecord. OccamsRecord.query(q).find_each { |order| ...
} OccamsRecord.query(q).find_in_batches { |orders| orders.each { |order| ... }
} If you're using PostgreSQL, consider using find_each_with_cursor or find_in_batches_with_cursor for a possible performance boost. See Cursors for more info.

